import React, { useState, useEffect } from "react"; import Footer from '../../estructura/Footer'
import Header from '../../estructura/Header'
import './Bebidas.css'

const Bebidas = () => {
  const [bebidas, setBebidas] = useState([]);

  useEffect(() => {
    fetch("https://api-rest-luis-r45f.vercel.app/products")
      .then((prod) => {
        return prod.json();
      })
      .then((prod) => {
        console.log(prod);
        setBebidas(prod);
      });
  }, []);

  return (
    <div>
      <Header />
      <h1 className="title">Bebidas</h1>
      <div className="container">
      {bebidas.map((prod) => {
          return (
            <div className="card">
              <img
                src={prod.image.secure_url}
                alt=""
                className="today-special__img"
              />
              <h4>{prod._id}</h4>
              <h2>{prod.name}</h2>
              <p>{prod.description}</p>
              <a>Realizar pedido</a>
            </div>
          );
        })}
      </div>
      <br /> <br />
    <Footer />
    </div>
  )
}

export default Bebidas
